// SPDX-License-Identifier: MIT
pragma solidity >=0.8.0;


import "@openzeppelin/contracts/security/ReentrancyGuard.sol";


contract WorkChain is ReentrancyGuard {

    event CreatedProject(uint ID, string  message);
    event DeadLineNotice (string message);
    event Completed(string message);
    event See (string message);

    enum IsAccepted {
        no,
        yes,
        dissatisfied,
        Reviewing

    }
    struct Project {
        uint256 ProjectID;
        address Employer;
        address Employee;
        string ProjectDescription;
        uint256 Budget;
        uint256 ProjectDuration;
        uint256 DeadLine;
        uint256 EndTime; 
        bool isActive;
        bool isCompleted;
        IsAccepted isaccepted;
    }


    Project[] public projects;
    mapping(address =>uint[]) public EmployerProjects;
    mapping(address =>uint[]) public EmployeeProjects;
    mapping(address =>uint256) public credits;
    mapping(address =>uint256) public lockedCredits;
    mapping(address =>uint256) private Employee_credits;
    mapping(address =>uint256) public Employee_lockedCredits;
    mapping (address => bool) private OwnerStatus;
    uint256 public treasury =0;
    address public owner1;
    address public owner2;
    uint32 public numConfirmation = 0;
    bool public status = true;







    modifier CheckBalance (uint256 Budget) {
        credits[msg.sender] += msg.value;
        if (msg.value < Budget){
            require (credits[msg.sender]>= Budget, 'Please Increase your credit');
            _;
        }
        _;
    }

    modifier CheckEmployee (uint256 _projectId){
        require(projects[_projectId - 1].Employee == msg.sender);
        _;
    }
    modifier CheckEmployer (uint256 _projectId){
        require(projects[_projectId - 1].Employer == msg.sender);
        _;
    }
    modifier onlyowner() {
        require (msg.sender == owner1 || msg.sender == owner2);
        _;
    }
    modifier working () {
        require (status);
        _;
    }

    constructor(address _owner1, address _owner2) {
        owner1 = _owner1;
        owner2 = _owner2;
        OwnerStatus[owner1] = false;
        OwnerStatus[owner2] = false;

    }








    function CreateProject(string memory ProjectDescription, uint256 Budget, uint256 ProjectDuration ) 
    public payable CheckBalance(Budget) working {
        require (ProjectDuration >0, 'Duration must be more than 0');
        credits[msg.sender] -= Budget;
        lockedCredits[msg.sender] += Budget;

        uint256 ProjectId = projects.length + 1;
        uint256 projectTime = ProjectDuration * 1 days;
        Project memory NewProject = Project(ProjectId, msg.sender,address(0), ProjectDescription,
        Budget, projectTime, 0, 0, true, false, IsAccepted.no);
        projects.push(NewProject);
        EmployerProjects[msg.sender].push(ProjectId);
        emit CreatedProject(ProjectId, 'Project is Active now');

    }

    function AcceptProject (uint256 _ProjectId ) public payable working{
        require(projects[_ProjectId - 1].isActive,'Invalid project ID or the project is not active');
        Employee_credits[msg.sender] += msg.value;
        uint256 guarantee = (projects[_ProjectId - 1].Budget * 20) /100;
        if (msg.value < guarantee){
            require (Employee_credits[msg.sender]>= guarantee, 'Please Increase your credit');
        }
        Employee_credits[msg.sender] -= guarantee;
        Employee_lockedCredits[msg.sender] += guarantee;
        projects[_ProjectId - 1].DeadLine = projects[_ProjectId - 1].ProjectDuration + block.timestamp;
        projects[_ProjectId - 1].Employee = msg.sender;
        projects[_ProjectId - 1].isActive = false;
        EmployeeProjects[msg.sender].push(_ProjectId);
        uint256 deadline = projects[_ProjectId - 1].ProjectDuration / 86400;
        string memory DeadLineMessage = string(abi.encodePacked('your deadline is',deadline,'days' ));

        emit DeadLineNotice(DeadLineMessage);

    }
    function CompletedProject (uint256 _ProjectId) public CheckEmployee(_ProjectId) {
        projects[_ProjectId - 1].isCompleted = true;
        projects[_ProjectId - 1].EndTime = block.timestamp;
        emit Completed('wait for confirmation');
    }

    function ConfirmedProject (uint256 _ProjectId) public CheckEmployer(_ProjectId){
        require(projects[_ProjectId - 1].isCompleted == true,' the project is not completed wait more');
        projects[_ProjectId - 1].isaccepted = IsAccepted.yes;
        emit See('see you soon for the next project');

    }

    function RealeasePayment(uint256 _ProjectId) public CheckEmployee(_ProjectId){
        require(projects[_ProjectId - 1].isaccepted == IsAccepted.yes,' you should wait more');
        uint256 budget = projects[_ProjectId - 1].Budget;

        if (projects[_ProjectId - 1].EndTime <= projects[_ProjectId - 1].DeadLine){
            lockedCredits[projects[_ProjectId - 1].Employer] -= budget;
            Employee_lockedCredits[projects[_ProjectId - 1].Employee] -= (budget * 20)/100;
            Employee_credits[projects[_ProjectId - 1].Employee] += ((budget * 20) + (budget * 95)) /100;
            treasury +=(budget * 5)/100;

        } else if (projects[_ProjectId - 1].EndTime - projects[_ProjectId - 1].DeadLine <= projects[_ProjectId - 1].ProjectDuration * 20/100){
            lockedCredits[projects[_ProjectId - 1].Employer] -= budget;
            credits[projects[_ProjectId - 1].Employer] += (budget * 10)/100;
            Employee_lockedCredits[projects[_ProjectId - 1].Employee] -= (budget * 20)/100;
            Employee_credits[projects[_ProjectId - 1].Employee] += ((budget * 20) + (budget * 80)) /100;
            treasury += (budget * 10)/100;

        } else {
            lockedCredits[projects[_ProjectId - 1].Employer] -= budget;
            credits[projects[_ProjectId - 1].Employer] += (budget * 30)/100;
            Employee_credits[projects[_ProjectId - 1].Employee] += (budget * 70)/100;
            Employee_lockedCredits[projects[_ProjectId - 1].Employee] -= (budget * 20)/100;
            treasury += (budget * 20)/100;

        }
    }
    function NotConfirmed (uint256 _ProjectId) public CheckEmployee(_ProjectId){
        require(projects[_ProjectId - 1].isaccepted != IsAccepted.dissatisfied, 'your client is not satisfied');
        require(block.timestamp >= projects[_ProjectId - 1].EndTime +1 days );
        projects[_ProjectId - 1].isaccepted = IsAccepted.yes;

    }

    function Dissatisfied (uint256 _ProjectId) public CheckEmployer(_ProjectId){
        require(projects[_ProjectId - 1].isCompleted == true, 'your peoject is not done');
        projects[_ProjectId - 1].isaccepted = IsAccepted.dissatisfied;

    }

    function Withdraw(uint256 _Amount, string memory _position) public nonReentrant {
        bytes32 positionHash = keccak256(bytes(_position));
        if (positionHash == keccak256("Employer")) {
            require(credits[msg.sender]>= _Amount);
            credits[msg.sender] -= _Amount;
            (bool success, ) = msg.sender.call{value: _Amount}("");
            require(success);


        } else if (positionHash == keccak256("Employee")) {
            require(Employee_credits[msg.sender]>= _Amount);
            Employee_credits[msg.sender] -= _Amount;
            (bool success, ) = msg.sender.call{value: _Amount}("");
            require(success);
        } 


    }
    function Review(uint256 _ProjectId) public {
        require(projects[_ProjectId - 1].Employer == msg.sender || projects[_ProjectId - 1].Employee == msg.sender,'wrong project ID');
        require(projects[_ProjectId - 1].isCompleted == true, 'your peoject is not done');
        projects[_ProjectId - 1].isaccepted = IsAccepted.Reviewing;

    }

    function finalDecision (uint256 _ProjectId, uint256 Proportion ) public onlyowner{
        require(Proportion<=70);
        require(projects[_ProjectId - 1].isaccepted == IsAccepted.Reviewing);
        projects[_ProjectId - 1].isaccepted == IsAccepted.yes;
        uint256 budget = projects[_ProjectId - 1].Budget;
        lockedCredits[projects[_ProjectId - 1].Employer] -= budget;
        credits[projects[_ProjectId - 1].Employer] += (budget * Proportion)/100;
        Employee_lockedCredits[projects[_ProjectId - 1].Employee] -= (budget * 20)/100;
        Employee_credits[projects[_ProjectId - 1].Employee] += ((budget * 20) + (budget * (100 - Proportion - 30))) /100;
        treasury += (budget * 30)/100;
    }

    function cancelProject (uint256 _ProjectId) public CheckEmployer(_ProjectId){
        require(projects[_ProjectId - 1].isActive == true);
        projects[_ProjectId - 1].isActive = false;
        uint256 budget = projects[_ProjectId - 1].Budget;
        lockedCredits[projects[_ProjectId - 1].Employer] -= budget;
        credits[projects[_ProjectId - 1].Employer] += budget;

    }



    function confirm() public onlyowner {

        OwnerStatus[msg.sender] = true;
    }

    function setPause (bool _paused) public onlyowner {
        require (OwnerStatus[owner1]  && OwnerStatus[owner2] ,'confirmation is not completed');
        status = _paused;
        OwnerStatus[owner1] = false;
        OwnerStatus[owner2] = false;

    }

    function WithdrawTreasury () public payable onlyowner() nonReentrant{

        (bool success,) = owner1.call{value:treasury}('');
        require(success,"Failed to send Ether");
        treasury = 0;

    }



    function get_project(uint256 _ProjectId) view public returns(uint256 ProjectID,
        address Employer,address Employee,string memory ProjectDescription,
        uint256 Budget, uint256 ProjectDuration,uint256 DeadLine,
        uint256 EndTime,bool isActive,bool isCompleted,IsAccepted isAccepted) {
        ProjectID =  projects[_ProjectId - 1].ProjectID;
        Employer =  projects[_ProjectId - 1].Employer;
        Employee =  projects[_ProjectId - 1].Employee;
        ProjectDescription =  projects[_ProjectId - 1].ProjectDescription;
        Budget =  projects[_ProjectId - 1].Budget;
        ProjectDuration = projects[_ProjectId - 1].ProjectDuration;
        DeadLine= projects[_ProjectId - 1].DeadLine;
        EndTime= projects[_ProjectId - 1].EndTime;
        isActive =  projects[_ProjectId - 1].isActive;
        isCompleted = projects[_ProjectId - 1].isCompleted;
        isAccepted = projects[_ProjectId - 1].isaccepted;


    }

    function get_employee_projects(address _address) view public returns(uint[] memory){
        return (EmployeeProjects[_address]);
    }

    function  get_employer_projects(address _address) view public returns(uint[] memory){
        return (EmployerProjects[_address]);


    }
    function  get_employer_creadits(address _address) view public returns(uint,uint){
        return (credits[_address],lockedCredits[_address]);

    }
    function  get_employee_creadits(address _address) view public returns(uint,uint){
        return (Employee_credits[_address],Employee_lockedCredits[_address]);

    }
    function  get_status() view public returns(bool){
        return (status);

    }
    function  get_treasury() view public returns(uint256){
        return (treasury);

    }



}
